import React from 'react';
import Header from '../header';
import BurgerMenu from '../burger-menu';

export default class App extends React.Component {
    state =() => {
        this.handleclick = () => {
            console.log('test');
        };
    };
    onToggleMenu = () => {
        this.setState((state) => {
            const item = <BurgerMenu/>;
            return { item }
        })
    };
    render() {
        return (
            <Header onclick={this.handleclick} />
        );
    };
};
